import React, { Component } from "react";
import { Link } from "react-router-dom";
import Accordion from 'react-bootstrap/Accordion';
class SideBarItem extends Component {
  
  render() {
    const { document } = this.props;
    return (

    <div className="row" id="main-content">
      <Accordion className="bg-light border card card-body " id="sidebar">
                <Accordion.Toggle as={document.subject} variant="link" eventKey="0" >
                    {document.subject} 
                </Accordion.Toggle>
            
             <Accordion.Collapse className="p-2" eventKey="0">
               <p>{document.topic}</p>   
               <Link to={`/content/${document.document_id}`}>
                  <li className="list-group-item update">
                    <i className="fa fa-edit pr-1"> Update Project Info</i>
                  </li>
                </Link>
             </Accordion.Collapse>
        
      </Accordion>  
    </div>
    


    );
  }
}

export default SideBarItem;
